      annotations:
        argocd.argoproj.io/tracking-id: argocd:/Secret:argocd/argocd-secret
        sealedsecrets.bitnami.com/managed: "true"
      labels:
        app.kubernetes.io/name: argocd-secret
        app.kubernetes.io/part-of: argocd
      name: argocd-secret
      namespace: argocd
    type: Opaque
